import React from "react";

import './Login.css';

export default class Login extends React.Component{ 
    constructor(props){
        super(props);
        this.state = {
            value: ''
        }

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event){
        this.setState({
            value: event.target.value
        });
    }

    handleSubmit(event){
        alert("Name submitted:" + this.state.value);
        event.preventDefault();
    }
    render(){
        return(
            <form id="login-form" onSubmit={this.handleSubmit}>
                <div class="mb-3">
                    <label class="form-label">Email address</label>
                    <input type="email" class="form-control" required></input>
                </div>
                <div class="mb-3">
                    <label for="inputPassword5" class="form-label">Password</label>
                    <input type="password" class="form-control" required></input>
                </div>
                <button type="submit" class="btn btn-primary mx-auto d-block">Login</button>
            </form>
        )
    }
}
